import axios from "axios";

function GetRequest() {
    const[userdata,setUseData] = useState([]);
  useEffect(()=>{
    axios.get("https://jsonplaceholder.typicode.com/posts")
    .then((response) =>{
    console.log(response);

    setUseData(response.data);

    })
  })
  return (
    <div>
        AxiosTopic 
        {userdata.map((data) => {  // ✅ Yahan curly braces sahi use karo
            return (
                <div key={data.id}>{data.name}</div>  // ✅ Unique key dena best practice hai
            );
        })}
    </div>
);
}

export default GetRequest
